              languages: 
                4: "Das Gebilde vor euch am Baum ist etwa einen Schritt hoch und \xE4hnelt stark einem kleinen Baum, gar einer Eiche. Die Wurzeln wurden so angefertigt, dass jene den Stamm halten k\xF6nnen. Der Stamm erscheint robust und beeinhaltet viele Einkerbungen, die an eine Rinde erinnern, die Farbe kommt einem dunklen Braunton gleich.\n\
                  Als der Stamm endet und sich einem geschnitzen Geflecht verl\xE4uft scheint der Braunton zu den Spitzen hin heller zuwerden, das Holz wirkt weicher und harmonischer als der Stamm.\n\
                  Viele Verzweigungen wurde geschnitzt und auch Bl\xE4tter aus Holz die matt gl\xE4nzen wurden mit gr\xF6\xDFer Sorgfalt an ihren Platz eingearbeit, man k\xF6nnte behaupten wenn man blinzelt das sich jene leicht in einem Windhauch wiegen.\n\
                  Zwei etwas dickere \xC4ste f\xFChren den Stamm nach oben hin weiter und verlaufen in sich selbst. Sie umschlingen sich, da wo sich die Baumkrone befinden sollte und umrahmen einen gl\xE4nzenden Alexandrit, welcher das Licht, das auf ihn f\xE4llt wie ein Prisma bricht und somit die verschiedenen sichtbaren Farben reflektiert und den Altar erstrahlen l\xE4sst."
